	global $res;
	foreach ($map as $v=>$k) {
		if ($v!="_") {
			$r['from']=$k["_"];
			$r['to']=$prev;
			$r['path']=$path . "-" . $v;
			$res[]=$r;
			unset($r);
//$k["_"] . "\n";
//print_r($map);

